import React from "react";
import largeLogo from "./ApartmintLogoSmall.png";
import "./App.css";
import topNavBar from "./components/topNavBar";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <topNavBar />
        <img src={largeLogo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
